blogs = Blog.create(title: 'A Pair and a Spare', description: 'Discovered for her incredible DIY skills, she makes the fashion cut for her classic, Madewell-like style and clean silhouette. Bests: Closet clean outs, Style breakdowns, City breakdowns', image_url: 'https://farm8.staticflickr.com/7483/16249635126_5af56e1233_b.jpg', url: 'http://apairandasparediy.com/', category_id: 1)
blogs = Blog.create(title: 'This Time Tomorrow', description: 'Refreshing to have a blogger who originated in SF (thing: killer boots and jackets). Now that she is in NYC, Krystals blog is still fabulously vintage, avant garde, and bold. Bests: Reviews of workout classes, make-up for dark coloring, and unique style that highlights the leg', image_url: 'https://s-media-cache-ak0.pinimg.com/236x/c4/85/be/c485be8cea2c5f48d94beaec70eff04e.jpg', url: 'http://thistimetomorrow.com/', category_id: 1)
blogs = Blog.create(title: 'Gal Meets Glam', description: 'A San Francisco native in Charleston SC, Julia Engels is known for her ladylike style, love of the color blush, and travel guides with her husband. Bests: Feminine Style (especially for Pears), natural makeup and hair how-tos', image_url: 'https://encrypted-tbn1.gstatic.com/images?q=tbn:ANd9GcRtQzWYeB-FsMErdt1TcEv5Q_sc4Rt0PDFgDt90QyKz1DZRtGSajQ', url: 'http://galmeetsglam.com/', category_id: 1)
blogs = Blog.create(title: 'Refinery29', description: 'Described as the Modern Womans guide for living a stylish life, there articles span far more than just style including health, tech, and politics. Bests— Interviews with cool girls and curated wardrobe pieces', image_url: 'https://d.fastcompany.net/multisite_files/codesign/imagecache/slideshow_large/slideshow/2013/07/1673127-slide-r29-logo-mark.jpg', url: 'http://www.refinery29.com/', category_id: 3)
blogs = Blog.create(title: 'Memorandum', description: 'Women in the workplace can either look sloppy or scandalous— and Mary Orton is here to fix that. Her tailored, fresh style and sassy opinion is great for anyone who wants to look good for work. Bests— Guides on appropriate work and wedding dresses.', image_url: 'https://encrypted-tbn1.gstatic.com/images?q=tbn:ANd9GcRbRWsbW1daCZmIpSstt_gx4RJWSkwWZB6o8p-zaxfm7mHlvOHn', url: 'http://www.memorandum.com/', category_id: 1 )
