blogs = Blog.create(title: 'Nitch', description: 'Technically an Instagram and not a blog, it is too damn inspirational not to leave out. Get ready for daily inspirational (and often unheard) quotes from historical figures in a stunning black and white format. Bests: Sign up for their newsletter for more indepth series with famous individuals', image_url: 'http://www.nitch.com/content/images/807251700349220864.jpg', url: 'http://www.nitch.com/', category_id: 7)
